import React from "react";

function HeaderWiget({ heding, text, img }) {
  return (
    <div className="HeaderWidget">
      <img className="HeaderWidget__img" src={img} alt="" />
      <h3 className="HeaderWidget__heading">{heding}</h3>
      <p className="HeaderWidget__p">{text}</p>
    </div>
  );
}

export default HeaderWiget;
